// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "./TicketProxy.sol";
import "./ticket/interface/ITicket.sol";

contract TicketFactory {
    address[] public proxies;

    address public impl;

    constructor(address _impl) {
        impl = _impl;
    }

    function addNewProxy() public {
        address newTicketProxy = address(new TicketProxy(impl));

        ITicket(newTicketProxy).initialize();
        proxies.push(newTicketProxy);
    }
}

contracts/TicketProxy.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

contract TicketProxy{
    
    address impl;
    
    constructor(address _logicContractAddress){
        impl = _logicContractAddress;
    }
    
    fallback() external {
        (bool success, bytes memory data) = impl.delegatecall(msg.data);
        require(success);
        //return data;
    }

    function changeImpl(address _impl) public {
        impl = _impl;
    }
}

