// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721URIStorageUpgradeable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./interface/ITicket.sol";
import "hardhat/console.sol";

error InvalidInput();
error InvalidAmount();
error Unavailable();
error Unauthorized();
error TransactionFailed();
error WinnerAlreadyChosen();

/// @title Ticket
/// @author Ivan Ivanov
/// @notice This contract gives permission to nft owners to deposit funds in the Lottery contract
contract Ticket is ReentrancyGuard, Initializable, ERC721URIStorageUpgradeable {
    using Counters for Counters.Counter;

    Counters.Counter public tokenIds;

    function initialize() external initializer {
      __ERC721_init("Ticket", "Tik");
    }

    function mint() external virtual {
      console.log("asdasd");
        _mint(msg.sender, tokenIds.current());
        tokenIds.increment();
    }
}

